style.css:
@-moz-document url-prefix("https://www.openstreetmap.org/id") {
.ideditor .top-toolbar {background: transparent; height: 40px; padding: 0; position: fixed; margin-top: 10px; width: fit-content;}
.ideditor .joined>* {border: none;}
.toolbar-item.old-modes .label {display: none;}
.ideditor .top-toolbar .toolbar-item .item-label {display: none;}

.ideditor .header {padding: 15px 40px;}
.ideditor .entity-editor {padding: 10px;}
.ideditor .preset-list {padding: 10px;}
.ideditor .section:not(:last-child), .ideditor .map-pane .section {margin-bottom: 20px;}
}
